import "./styles.css";
import { ReactComponent as LogoCE } from "../../assets/logo.svg";
import { UseAuth } from "../../contexto/AuthContext";
import { Link } from "react-router-dom";

export default function Logo() {
  const { gravarUsuario } = UseAuth();
  return (
    <div className="logo">
      <LogoCE />
      <div className="links">
        <Link path="/">Perfil</Link>
        <a
          target="_blank"
          href="https://clarke.com.br/simulador/"
          rel="noreferrer"
        >
          Simulador
        </a>
        <a target="_blank" href="https://clarke.com.br/blog/" rel="noreferrer">
          Blog
        </a>
      </div>

      {/* {gravarUsuario.token && <a href="/">Perfil</a>} */}
    </div>
  );
}
